function Set-Icons($IconBase) {

  $LogoImageBytes=[Convert]::FromBase64String($IconBase)
  $LogoMemStream=New-Object IO.MemoryStream($LogoImageBytes, 0, $LogoImageBytes.Length)
  $LogoMemStream.Write($LogoImageBytes, 0, $LogoImageBytes.Length)
  return [System.Drawing.Image]::FromStream($LogoMemStream, $True)

}

